import './App.css';
import Navbar from './component/Navbar';
import News from './component/News';
import {
  BrowserRouter as Router,
  Link,
  Routes,
  Route
} from 'react-router-dom'

function App() {

  return (
    <>
    <Router>
    <Navbar/>
    <Routes>
      <Route path=''><News pageSize={5} country={"in"} category='sports'/></Route>
    </Routes>

    </Router>

    </>
  );
}

export default App;
